Vanessa Parada / TwitterVanessa从未有过任何正式的演员工作，但她似乎已经准备好了。无论她现在是否扮演一个角色，作为一个艺术家，她会走得很远，因为她在镜头前有着疯狂的才华。如果你想要看一些（相当直白地说——她的应用程序上甚至有一些暗示性和乳头照片），她每天至少发帖两次，内容基本上是关于任何事情。

